import React from 'react'
import { Tabla } from './Tabla'

export const Registros = (props) => {
    const {registroOdontograma, setregistroOdontograma, fecha} = props

    return (
        <div className='row mt-3'>
            <div className='col'>
                {registroOdontograma[0] === undefined ?
                <div className='alert alert-warning' role="alert">
                    {fecha}
                </div>
                :
                <Tabla registroOdontograma={registroOdontograma} setregistroOdontograma={setregistroOdontograma} />
                }
            </div>
        </div>
    )
}
